import React from 'react';
import Styles from './Card.module.css';

const Card = (props)=>{
    const {src} = props;
    if(props.impar){
        const clase = Styles.impar;
    }else{
        const clase = Styles.container;
    }
    return (
        <div>
            <img className = {clase} src = {src}  height = {props.height} width = {props.width}>

            </img>
        </div>
    )
}
export default Card;
